import logo from './logo.svg';
import './App.css';
import Row from 'react-bootstrap/Row';

function App() {
  return (
      <div className="align-items-center justify-content-center" style={{ display: 'block',
        width: 1000, padding: 30 }}>
        <h1>Fun with AI</h1>
        <Row style={{
          backgroundColor: 'red',
        }}>
          Sample First Row
        </Row>
        <Row style={{
          backgroundColor: 'yellow',
        }}>
          Sample Second Row
        </Row>
        <Row style={{
          backgroundColor: 'green',
        }}>
          Sample Third Row
        </Row>
      </div>
  );
}

export default App;
